import React, { useState } from 'react';

const Dashboard = () => {
  const [activeModule, setActiveModule] = useState(null);
  const [uploadedFile, setUploadedFile] = useState(null);
  const [dragOver, setDragOver] = useState(false);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      setUploadedFile(file);
    }
  };

  const handleDragOver = (event) => {
    event.preventDefault();
    setDragOver(true);
  };

  const handleDragLeave = (event) => {
    event.preventDefault();
    setDragOver(false);
  };

  const handleDrop = (event) => {
    event.preventDefault();
    setDragOver(false);
    const file = event.dataTransfer.files[0];
    if (file) {
      setUploadedFile(file);
    }
  };

  const modules = [
    {
      id: 'skin',
      title: 'Skin Cancer Detection',
      description: 'Upload a skin lesion image for AI-powered analysis and risk assessment.',
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
        </svg>
      ),
      color: 'primary',
      bgColor: 'bg-primary-100',
      textColor: 'text-primary-600',
      buttonColor: 'btn-primary',
      acceptedFiles: '.jpg,.jpeg,.png,.bmp,.tiff',
      features: ['ABCDE Analysis', 'Visual Overlays', 'Risk Assessment', '7 Condition Types']
    },
    {
      id: 'radiology',
      title: 'Radiology Analysis',
      description: 'Analyze chest X-rays and CT scans for pathological findings and anomalies.',
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
        </svg>
      ),
      color: 'secondary',
      bgColor: 'bg-secondary-100',
      textColor: 'text-secondary-600',
      buttonColor: 'btn-secondary',
      acceptedFiles: '.jpg,.jpeg,.png,.dcm,.dicom',
      features: ['14 Pathologies', 'Urgency Assessment', 'DICOM Support', 'Multi-label Detection']
    },
    {
      id: 'triage',
      title: 'Virtual Triage Assistant',
      description: 'Describe symptoms for intelligent triage assessment and guidance.',
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 12h.01M12 12h.01M16 12h.01M21 12c0 4.418-4.03 8-9 8a9.863 9.863 0 01-4.255-.949L3 20l1.395-3.72C3.512 15.042 3 13.574 3 12c0-4.418 4.03-8 9-8s9 3.582 9 8z" />
        </svg>
      ),
      color: 'info',
      bgColor: 'bg-info-100',
      textColor: 'text-info-600',
      buttonColor: 'btn-outline',
      features: ['Natural Language', 'Symptom Analysis', '24/7 Available', 'Urgency Levels']
    }
  ];

  const stats = [
    { label: 'Total Analyses', value: '0', color: 'text-primary-600', icon: 'üìä' },
    { label: 'This Month', value: '0', color: 'text-secondary-600', icon: 'üìà' },
    { label: 'Urgent Cases', value: '0', color: 'text-warning-600', icon: '‚ö†Ô∏è' },
    { label: 'AI Accuracy', value: '95%', color: 'text-info-600', icon: 'üéØ' }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-neutral-50 to-primary-50">
      <div className="container mx-auto px-4 py-8">
        {/* Header */}
        <div className="page-header">
          <h1 className="page-title">
            Welcome to MedAI Copilot
          </h1>
          <p className="page-subtitle">
            Your intelligent healthcare assistant powered by advanced AI technology
          </p>
        </div>

        {/* Quick Stats */}
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mb-12">
          {stats.map((stat, index) => (
            <div key={index} className="stats-card">
              <div className="text-2xl mb-2">{stat.icon}</div>
              <div className={`stats-number ${stat.color}`}>{stat.value}</div>
              <div className="stats-label">{stat.label}</div>
            </div>
          ))}
        </div>

        {/* Main Modules */}
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 mb-12">
          {modules.map((module) => (
            <div key={module.id} className="feature-card">
              <div className={`feature-icon ${module.bgColor} ${module.textColor}`}>
                {module.icon}
              </div>
              <h3 className="feature-title">{module.title}</h3>
              <p className="feature-description">{module.description}</p>

              {/* Features List */}
              <div className="mb-6">
                <div className="grid grid-cols-2 gap-2">
                  {module.features.map((feature, index) => (
                    <div key={index} className="flex items-center gap-2 text-xs text-neutral-600">
                      <svg className="w-3 h-3 text-secondary-500" fill="currentColor" viewBox="0 0 20 20">
                        <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                      </svg>
                      {feature}
                    </div>
                  ))}
                </div>
              </div>

              <button 
                className={`btn ${module.buttonColor} w-full`}
                onClick={() => setActiveModule(module.id)}
              >
                {module.id === 'triage' ? 'Start Chat' : 'Upload Image'}
              </button>
            </div>
          ))}
        </div>

        {/* Active Module Interface */}
        {activeModule && (
          <div className="card mb-8">
            <div className="card-header">
              <div className="flex items-center justify-between">
                <h2 className="card-title">
                  {modules.find(m => m.id === activeModule)?.title}
                </h2>
                <button 
                  onClick={() => setActiveModule(null)}
                  className="btn btn-ghost btn-sm"
                >
                  <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                  </svg>
                </button>
              </div>
            </div>

            {activeModule === 'triage' ? (
              /* Triage Chat Interface */
              <div className="space-y-4">
                <div className="bg-neutral-50 rounded-lg p-4">
                  <div className="flex items-start gap-3">
                    <div className="w-8 h-8 bg-info-100 text-info-600 rounded-full flex items-center justify-center text-sm font-semibold">
                      AI
                    </div>
                    <div className="flex-1">
                      <p className="text-sm text-neutral-700">
                        Hello! I'm your virtual triage assistant. Please describe your symptoms, 
                        and I'll help assess the urgency and provide guidance.
                      </p>
                    </div>
                  </div>
                </div>

                <div className="flex gap-3">
                  <input 
                    type="text" 
                    placeholder="Describe your symptoms..."
                    className="input flex-1"
                  />
                  <button className="btn btn-primary">
                    <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8" />
                    </svg>
                    Send
                  </button>
                </div>
              </div>
            ) : (
              /* File Upload Interface */
              <div className="space-y-6">
                <div 
                  className={`upload-area ${dragOver ? 'dragover' : ''}`}
                  onDragOver={handleDragOver}
                  onDragLeave={handleDragLeave}
                  onDrop={handleDrop}
                  onClick={() => document.getElementById('file-input').click()}
                >
                  <div className="upload-icon">
                    <svg fill="none" stroke="currentColor" viewBox="0 0 24 24" className="w-16 h-16">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M7 16a4 4 0 01-.88-7.903A5 5 0 1115.9 6L16 6a5 5 0 011 9.9M15 13l-3-3m0 0l-3 3m3-3v12" />
                    </svg>
                  </div>
                  <h3 className="text-lg font-semibold text-neutral-700 mb-2">
                    {uploadedFile ? uploadedFile.name : 'Drop your medical image here'}
                  </h3>
                  <p className="text-neutral-500 mb-4">
                    or click to browse files
                  </p>
                  <div className="text-sm text-neutral-400">
                    Supported formats: {modules.find(m => m.id === activeModule)?.acceptedFiles}
                  </div>
                  <input 
                    id="file-input"
                    type="file" 
                    className="hidden"
                    accept={modules.find(m => m.id === activeModule)?.acceptedFiles}
                    onChange={handleFileUpload}
                  />
                </div>

                {uploadedFile && (
                  <div className="bg-secondary-50 border border-secondary-200 rounded-lg p-4">
                    <div className="flex items-center gap-3">
                      <div className="w-10 h-10 bg-secondary-100 text-secondary-600 rounded-lg flex items-center justify-center">
                        <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
                        </svg>
                      </div>
                      <div className="flex-1">
                        <p className="font-medium text-neutral-800">{uploadedFile.name}</p>
                        <p className="text-sm text-neutral-500">
                          {(uploadedFile.size / 1024 / 1024).toFixed(2)} MB
                        </p>
                      </div>
                      <button className="btn btn-primary">
                        <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
                        </svg>
                        Analyze
                      </button>
                    </div>
                  </div>
                )}
              </div>
            )}
          </div>
        )}

        {/* Recent Activity */}
        <div className="card">
          <div className="card-header">
            <h2 className="card-title">Recent Activity</h2>
            <p className="card-subtitle">Your latest medical analyses and consultations</p>
          </div>

          <div className="space-y-4">
            <div className="flex items-center justify-center py-12 text-neutral-500">
              <div className="text-center">
                <svg className="w-16 h-16 mx-auto mb-4 text-neutral-300" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5H7a2 2 0 00-2 2v10a2 2 0 002 2h8a2 2 0 002-2V7a2 2 0 00-2-2h-2M9 5a2 2 0 002 2h2a2 2 0 002-2M9 5a2 2 0 012-2h2a2 2 0 012 2" />
                </svg>
                <h3 className="text-lg font-medium text-neutral-600 mb-2">No analyses yet</h3>
                <p className="text-neutral-500">
                  Start by uploading a medical image or chatting with our triage assistant
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
